import React from 'react';

const CargoItem = ({ cargo }) => {
  return (
    <tr>
      <td>{cargo.id}</td>
      <td>{cargo.name}</td>
      <td>{cargo.status}</td>
      <td>{cargo.origin}</td>
      <td>{cargo.destination}</td>
      <td>{cargo.departureDate}</td>
    </tr>
  );
};

export default CargoItem;
